import web from "..//src/images/web.jpg";
import os from "..//src/images/os.jpg";
import pl from "..//src/images/pl.jpg";
import virtual from "..//src/images/virtual.jpg";
import mob from "..//src/images/mob.jpg";
import data from "..//src/images/data.jpg";



const Carddata = [
    {
        imgsrc:web,
        title: "Web Development",
    },
    {
        imgsrc:mob,
        title: "Mobile Appliction",
    },
    {
        imgsrc:data,
        title: "Database",
    },
    {
        imgsrc:virtual,
        title: " Virtualization",
    },
    {
        imgsrc:pl,
        title: "Programming Languages",
    },
    {
        imgsrc:os,
        title: "Operating Sytems",
    },
];

export default Carddata;
